import React from 'react';
import './Projects.css';

const projects = [
  {
    title: 'Smart Attendance System',
    description: 'A web-based facial recognition system for automated student attendance, reducing manual errors and saving time.',
    tech: ['React', 'Node.js', 'Express.js', 'MongoDB', 'OpenCV'],
    link: 'https://github.com/your-github/smart-attendance',
    demo: '',
  },
  {
    title: 'Personal Portfolio Website',
    description: 'A responsive and modern portfolio website to showcase my projects, skills, and achievements.',
    tech: ['React', 'CSS', 'AOS'],
    link: 'https://github.com/your-github/portfolio',
    demo: '',
  },
  {
    title: 'E-Commerce REST API',
    description: 'A scalable RESTful API for an e-commerce platform with authentication, product management, and order processing.',
    tech: ['Node.js', 'Express.js', 'MongoDB', 'JWT'],
    link: 'https://github.com/your-github/ecommerce-api',
    demo: '',
  },
];

function Projects() {
  return (
    <section className="projects" id="projects" data-aos="fade-up">
      <h2 className="section-title">Projects</h2>
      <div className="projects__grid">
        {projects.map((project) => (
          <div className="project__card" key={project.title}>
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <div className="project__tech">
              {project.tech.map((t) => (
                <span key={t}>{t}</span>
              ))}
            </div>
            <div className="project__links">
              <a href={project.link} target="_blank" rel="noopener noreferrer">GitHub</a>
              {project.demo && <a href={project.demo} target="_blank" rel="noopener noreferrer">Demo</a>}
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Projects;
